    //         index={index} 
    //         key={key+index}
    //         src={photo.src} 
    //         width={photo.width} 
    //         height={photo.height} 
    //         margin={"2px"} 
    //         selected={false} 
    //     /> 
    // );} 


    const imageRenderer = useCallback(
        ({ index, left, top, key, photo }) => (
          <SelectedImage
            selected={false}
            key={key}
            margin={"2px"}
            index={index}
            photo={photo}
            left={left}
            top={top}
          />
        ),
        []
      );

    return (<> 
                <div className='content'> 
                    <h1>Main Content</h1>  
                    <Gallery photos={images} renderImage={imageRenderer} /> 
                </div>
            </>); 
}
